import React, { Component } from 'react';

class NewsItem extends Component {
    constructor(props) {
        super(props)
    }
    render() {
        return (
            <div className="col-4">
            <div className="card-deck">
              <div className="card">
                <a href="details.html"><img className="card-img-top" src={this.props.pic} alt="" /></a>
                <div className="card-body">
                  <h4 className="card-title text-align-center">{this.props.title}</h4>
                  <p className="card-text">Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. Vestibulum tortor quam, feugiat vitae, ultricies eget,...</p>
                </div>
              </div>
            </div>
            <hr />
          </div>
        );
    }
}

export default NewsItem;
